import { Directive, Input, OnChanges, OnInit, SimpleChanges } from '@angular/core';
import { AbstractControl, ControlValueAccessor, FormControl } from '@angular/forms';

@Directive()
export class CustomFormControl implements OnInit, OnChanges, ControlValueAccessor {

  readonly formId: string = `${Math.floor(Math.random() * Math.floor(Math.random() * Date.now()))}`;

  @Input() formControl: AbstractControl = new FormControl();

  @Input() label: string;

  @Input() disabled: boolean = false;

  @Input() fieldDisabledOverride: boolean = false; // This overrides disabled state

  @Input() prefix: string;

  @Input() suffix: string;

  @Input() showLabel: boolean = true;

  @Input() submitAttempt: boolean = false;

  @Input() defaultValue: any;

  @Input() loading: boolean = false;

  @Input() customErrorMessages: Record<string, string | (() => string)>

  @Input() debug: boolean = false; // Only to be used in dev / storybook

  onChange: (value: any) => void;

  onTouched: () => void;

  tooltipEnabled: boolean = false;

  showToolTip: (containerElement: HTMLElement, textElement: HTMLElement) => void = (containterElement, textElement) => {
    this.tooltipEnabled = containterElement.offsetWidth > ( textElement.offsetWidth - 41 )
  }

  focused: boolean = false;

  value: any;

  customFormControl: boolean = false;


  ngOnInit (): void {
    if ( !this.formControl.value && this.defaultValue !== undefined  ) {
      this.formControl.setValue(this.defaultValue, { emitEvent: false });
    }
  }

  ngOnChanges ( changes: SimpleChanges): void {
    if ( changes.formControl ) {
      this.customFormControl = true;
    }
  }

  writeValue( value: any, inputChange: boolean = false ): void {
    if ( this.formControl.updateOn === 'blur' ) {
      return;
    }

    this.value = value;

    if (JSON.stringify(value) !== JSON.stringify(this.formControl.value) && !inputChange) {
      this.formControl.setValue(value);
    }

    // On want to trigger on change if it is not a form control
    if ( !this.customFormControl ) {
      this.onChange?.(value);
    }
  }

  registerOnChange (fn: any): void {
    this.onChange = fn;
  }

  registerOnTouched(fn: any): void {
    this.onTouched = fn;
  }

  onBlur(): void {
    this.focused = false;
    const noValue = this.value === ''
     || this.value === undefined
     || this.value === null
     || this.value?.length === 0;

    if ( noValue && this.defaultValue !== undefined  ) {
      this.value = JSON.parse(JSON.stringify(this.defaultValue));
      this.formControl.setValue(this.value);
    }
  }

  setDisabledState(isDisabled: boolean): void {

    console.log(isDisabled);
    console.log(this.formControl.disabled);

    // if ( this.fieldDisabledOverride ) {
    //   this.disabled = true;
    //   this.formControl.disable();
    //   return;
    // }

    this.disabled = isDisabled;
    // if (isDisabled === this.formControl.disabled) {
    //   return;
    //  }

    console.log(this.disabled);
    if ( this.disabled ) {

      this.formControl.disable();
    } else {
      this.formControl.enable();
    }
  }
}

import { Directive, ElementRef, Input } from '@angular/core';

@Directive({
  selector: '[stringHighlight]'
})
export class HighlightDirective {

  @Input() set stringHighlight (highlightText) {
    this.highLightString(highlightText);

  }

  constructor(private el: ElementRef) {}

 highLightString ( searchString = ''): void {
   // Get inner html and remove any highlights
   let elementInnerHtml = this.el.nativeElement.innerHTML
    .replace('<strong>', '')
    .replace('</strong>', '')
    .trim();

    if( ( !searchString || searchString === '' ) && elementInnerHtml ) {
      this.el.nativeElement.innerHTML = elementInnerHtml;
      return;
    }

    const regex = new RegExp(searchString, 'ig').exec(elementInnerHtml);

    if ( regex?.[0] ) {
      elementInnerHtml = elementInnerHtml.replace(regex[0],`<strong>${regex[0]}</strong>` )
      this.el.nativeElement.innerHTML = elementInnerHtml;
    }
 }
}

import { Directive, ElementRef, Input } from '@angular/core';

@Directive({
  selector: '[showToolTip]'
})
export class showToolTipDirective {

  @Input() containerElement: HTMLElement;

  @Input() textElement: HTMLElement;

  tooltipDisabled: boolean = false;

  constructor(private el: ElementRef) {
    el.nativeElement.onmouseover = () => {
      const containerWidth = this.el.nativeElement.offsetWidth;
      const childWidth = this.el.nativeElement.childNodes[0].offsetWidth;
      console.log('Mouseover!', containerWidth, childWidth);

      this.el.nativeElement.tooltipDisabled = containerWidth >= childWidth;
    }
  }
}

